function cwbColorLegend(x = 0) {

    if (x == 0) { return [255, 255, 255, 0] }
    else if (x > 0 && x <= 1) { return [201, 201, 201, 0.4] }
    else if (x > 1 && x <= 2) { return [156, 254, 255, 0.4] }
    else if (x > 2 && x <= 6) { return [1, 210, 253, 0.4] }
    else if (x > 6 && x <= 10) { return [0, 166, 255, 0.4] }
    else if (x > 10 && x <= 15) { return [1, 119, 253, 0.4] }
    else if (x > 15 && x <= 20) { return [39, 163, 27, 0.4] }
    else if (x > 20 && x <= 30) { return [1, 251, 48, 0.4] }
    else if (x > 30 && x <= 40) { return [254, 253, 49, 0.4] }
    else if (x > 40 && x <= 50) { return [255, 211, 40, 0.4] }
    else if (x > 50 && x <= 70) { return [255, 167, 31, 0.4] }
    else if (x > 70 && x <= 90) { return [255, 43, 6, 0.4] }
    else if (x > 90 && x <= 110) { return [218, 35, 4, 0.4] }
    else if (x > 110 && x <= 130) { return [170, 24, 1, 0.4] }
    else if (x > 130 && x <= 150) { return [170, 33, 163, 0.4] }
    else if (x > 150 && x <= 200) { return [219, 45, 210, 0.4] }
    else if (x > 200 && x <= 300) { return [255, 56, 251, 0.4] }
    else if (x > 300) { return [255, 213, 253, 0.4] }

}
